INSERT INTO `product` (`product_id`, `category`, `product_name`, `product_img`, `introduction`, `product_stock`) VALUES
(1, '狗飼料', '希爾思-幼犬小顆粒', 'dogfeed1.png', '與視力發育優質蛋白質，以建構精實肌肉均衡比例礦物質強健骨骼與牙齒突破性的益生纖維複合配方，能打造健康的腸道微生物菌叢，維持消化道機能維生素E與Omega-6脂肪酸幫助皮膚及毛髮健康萃取自魚油的DHA有助腦部健康', 999),
(2, '狗飼料', '希爾思-幼犬-小型及迷你幼犬', 'dogfeed2.png', '萃取自魚油的DHA幫助腦部發育、眼睛發育\r\n優質蛋白質以建構精實肌肉\r\n突破性的益生纖維複合配方，能打造健康的腸道微生物菌叢，維持消化道機能\r\n小型及迷你犬的專用抗氧化複合配方支持終身健康免疫力\r\n', 999),
(3, '狗飼料', '希爾思-幼犬-大型幼犬', 'dogfeed3.png', '希爾思寵物食品 大型幼犬乾糧，最佳鈣含量特製配方，有助於調控骨骼生長，符合大型幼犬獨特需求。讓健康贏在起跑點，日益茁壯，發揮成長潛能。\r\n\r\n均衡比例礦物質強健骨骼與牙齒\r\n萃取自魚油的DHA有助腦部健康與視力發育\r\n優質蛋白質以建構精實肌肉\r\n\r\n\r\n', 999),
(4, '狗飼料', '希爾思-成犬-小型及迷你成犬', 'dogfeed4.png', '希爾思寵物食品 小型及迷你成犬乾糧，專為黃金時期的小型迷你成犬需求量身訂製，專屬小型犬喜好的顆粒質地\r\n\r\n均衡比例的營養幫助狗狗維持理想體重\r\n好消化食材，如: 南瓜等，能幫助健康消化及良好的便便品質\r\n黃金比例的蛋白質、脂肪和碳水化合物，提供狗狗所需能量\r\n小型及迷你犬量身訂製的抗氧化營養配方，有助於維持終生免疫力希爾思寵物食品 小型及迷你成犬乾糧，專為黃金時期的小型迷你成犬需求量身訂製，專屬小型犬喜好的顆粒質地\r\n', 999),
(5, '狗飼料', '希爾思-成犬-成犬 完美消化', 'dogfeed5.png', '益生纖維對健康至關重要，它是腸道微生物菌叢中，數百萬微生物的食物來源。希爾思突破性的ActivBiome+ (益菌纖活+科技) 即益生纖維綜合配方，促進寵物獨特的微生物菌叢，達到消化及整體健康:\r\n\r\nActivBiome+ (益菌纖活+科技) 獨家益生纖維複合配方，含有全穀粒燕麥、南瓜等食材\r\n美味的鮭魚食譜不僅提供均衡營養，也幫助愛犬保持最佳狀態\r\n幫助愛犬吸收並利用重要營養素\r\n鮭魚的優質蛋白質及其他食材能幫助維持精實肌肉\r\n均衡營養和礦物質促進重要器官健康\r\n', 999),
(6, '狗飼料', '希爾思-成犬-大型成犬', 'dogfeed6.png', '希爾思寵物食品 大型成犬乾糧，為大型成犬壯年期能量需求量身打造\r\n使用高品質、易消化食材製作\r\n天然來源的葡萄糖胺與軟骨素可維持關節健康\r\nOmega-6 與維生素 E 有助皮毛亮麗\r\n優質蛋白質以建構精實肌肉\r\n', 999),
(7, '狗飼料', '希爾思-成犬 7歲以上-小顆粒', 'dogfeed7.png', '希爾思寵物食品 成犬 7歲以上 小顆粒乾糧，專為7歲以上熟齡犬特殊需求所研發。黃金比例複合配方，不僅易消化並有助增加精力與活動力。小顆粒美味營養。\r\n均衡比例礦物質維持心臟與腎臟健康\r\nOmega-6 與維生素 E 有助皮毛亮麗\r\n優質蛋白質以建構精實肌肉\r\n', 999),
(8, '狗飼料', '希爾思-成犬 7歲以上-小顆粒', 'dogfeed8.png', '希爾思寵物食品 小型及迷你成犬 7歲以上乾糧，專為小型迷你熟齡犬量身打造的營養配方，可幫助維持熟齡期健康。特製小顆粒，混合營養配方幫助活力及能量滿滿。\r\n高效的抗氧化物複方提升狗狗免疫健康\r\n均衡比例礦物質可維持心臟、腎臟及膀胱健康\r\n易消化食材幫助消化健康\r\n完整均衡的營養幫助保持狗狗理想體重\r\n', 999),
(9, '狗飼料', '希爾思-小型及迷你成犬 11歲以上', 'dogfeed9.png', '希爾思寵物食品 小型及迷你成犬 11歲以上乾糧，為小型迷你高齡犬量身訂製的營養配方，可幫助維持高齡期健康。添加益生纖維搭配特製小顆粒，有助消化健康。\r\n萃取自魚油的Omega-3有助關節健康及活動力\r\n均衡比例礦物質可維持心臟、腎臟及膀胱健康\r\nOmega-6 脂肪酸及維生素 E 混合配方，打造健康皮膚和亮麗毛髮\r\n特製小型及迷你犬的抗氧化物混合配方，幫助終身免疫力\r\n', 999),
(10, '貓飼料', '希爾思-幼貓', 'catfeed1.png', '希爾思寵物食品 幼貓乾糧，精心調配幼貓生長所需營養，幫助健康成長贏在起跑點，並支持健康的免疫系統。\r\n萃取自魚油的 DHA 助益於腦部健康與視力發育\r\n優質蛋白質以建構精實肌肉\r\n最佳益菌生混合配方幫助消化健康\r\n均衡比例礦物質強健骨骼與牙齒\r\n維生素E與Omega-6幫助皮膚及毛髮健康\r\n', 999),
(11, '貓飼料', '希爾思-成貓', 'catfeed2.png', '希爾思寵物食品 成貓乾糧，專為成貓壯年期能量需求量身打造，使用高品質、易消化食材製作\r\n貓咪必需的牛磺酸可促進心臟健康，以及均衡比例的礦物質能維持腎臟與膀胱健康\r\n優質蛋白質以建構精實肌肉\r\n維生素 E、Omega-3 與 Omega-6 有助皮毛亮麗\r\n', 999),
(12, '貓飼料', '希爾思-成貓-低卡', 'catfeed3.png', '希爾思寵物食品 成貓 低卡乾糧，專為低活動量、低熱量需求成貓所打造的精確營養，能幫助維持健康的體重與生活\r\n低卡路里與左旋肉酸素有助於維持理想體重\r\n優質蛋白質與天然纖維可幫助於正餐間維持飽足感\r\nOmega-6 與維生素 E有助皮毛亮麗\r\n', 999),
(13, '貓飼料', '希爾思-成貓', 'catfeed4.png', '希爾思寵物食品 成貓 7歲以上乾糧，幫助貓咪維持熟齡期健康。特製複合營養配方，幫助熟齡貓增加精力與活動力\r\n貓咪必需的牛磺酸可促進心臟健康，以及均衡比例礦物質維持腎臟與膀胱健康\r\n易消化的成份與天然纖維可促進消化健康\r\n維生素 E、Omega-3 與 Omega-6 有助皮毛亮麗\r\n', 999),
(14, '貓飼料', '希爾思-成貓 7歲以上-室內成貓', 'catfeed5.png', '希爾思寵物食品 室內成貓 7歲以上乾糧，專為室內熟齡貓老年期能量需求量身打造\r\n天然纖維促進消化健康，優質食材讓清理貓砂變得好輕鬆\r\n優質蛋白質以建構精實肌肉\r\n使用天然優質、易消化食材製作的美味營養\r\n', 999),
(15, '貓飼料', '希爾思-成貓 11歲以上', 'catfeed6.png', '希爾思寵物食品 成貓 11歲以上乾糧，幫助貓咪維持高齡期健康。特製複合營養配方，有助高齡貓維持靈活、增加機警敏銳與互動意願\r\n貓咪必需的牛磺酸可促進心臟健康，以及均衡比例的礦物質能維持腎臟與膀胱健康\r\n易消化的成份與天然纖維可促進消化健康\r\n維生素 E、Omega-3 與 Omega-6 有助皮毛亮麗\r\n', 999),
(16, '貓罐頭', '希爾思-成貓-泌尿道毛球控制', 'catcan1.png', '希爾思寵物食品 成貓 11歲以上乾糧，幫助貓咪維持高齡期健康。特製複合營養配方，有助高齡貓維持靈活、增加機警敏銳與互動意願\r\n貓咪必需的牛磺酸可促進心臟健康，以及均衡比例的礦物質能維持腎臟與膀胱健康\r\n易消化的成份與天然纖維可促進消化健康\r\n維生素 E、Omega-3 與 Omega-6 有助皮毛亮麗\r\n', 999),
(17, '貓罐頭', '希爾思-成貓-敏感胃腸與皮膚', 'catcan2.png', '添加富含營養的益生纖維－果寡糖 幫助消化健康，滋潤皮膚並增加毛髮光澤', 999),
(18, '貓飼料', '紐頓-幼貓-S1均衡健康幼貓糧', 'catfeed8.png', '產地：加拿大\r\n適用對象：幼貓\r\n熱量：3820cal/kg\r\n保存期限：依包裝標示\r\n注意事項：開封後請儘速食用完畢。請存放於陰涼乾燥的環境，避免陽光直射\r\n', 999),
(19, '貓飼料', '紐頓-成貓-S5均衡健康成貓&熟齡貓糧', 'catfeed9.png', '產地：加拿大\r\n適用對象：成貓熟齡貓\r\n熱量：3700cal/kg\r\n保存期限：依包裝標示\r\n注意事項：開封後請儘速食用完畢。請存放於陰涼乾燥的環境，避免陽光直射\r\n', 999),
(20, '狗飼料', '紐頓-幼犬-S2均衡健康幼犬糧', 'dogfeed10.png', '產地：加拿大\r\n適用對象：幼犬\r\n熱量：3740cal/kg\r\n保存期限：依包裝標示\r\n注意事項：開封後請儘速食用完畢。請存放於陰涼乾燥的環境，避免陽光直射\r\n\r\n', 999),
(21, '狗飼料', '紐頓-成犬-S6均衡健康幼犬糧', 'dogfeed11.png', '產地：加拿大\r\n適用對象：幼犬\r\n熱量：3740cal/kg\r\n保存期限：依包裝標示\r\n注意事項：開封後請儘速食用完畢。請存放於陰涼乾燥的環境，避免陽光直射', 999),
(22, '貓砂', 'Nurture PRO 天然密碼 豆腐砂 原味6L (2入)', 'litter.png', '產地\r\n中國\r\n適用對象\r\n全齡貓\r\n成分\r\n豆腐、玉米粉、玉米澱粉、檸檬酸\r\n保存期限\r\n依包裝標示\r\n注意事項\r\n請於乾淨的便盆中倒入2～5公分高度的貓砂，經常鏟除及清理結塊！並定期整盆更換\r\n', 999),
(23, '貓砂', 'Nurture PRO 天然密碼 豆腐砂 綠茶6L (2入)', 'litter.png', '產地：中國\r\n適用對象：全齡貓\r\n成分：豆腐、玉米澱粉、檸檬酸\r\n保存期限：依包裝標示\r\n注意事項：請於乾淨的便盆中倒入2～6公分高度的貓砂，經常鏟除及清理結塊！並定期整盆更換\r\n', 999),
(24, '貓砂', 'Nurture PRO 天然密碼 豆腐砂 玉米6L (2入)', 'litter.png', '產地：中國\r\n適用對象：全齡貓\r\n成分：豆腐、玉米澱粉、檸檬酸\r\n保存期限：依包裝標示\r\n注意事項：請於乾淨的便盆中倒入2～7公分高度的貓砂，經常鏟除及清理結塊！並定期整盆更換\r\n', 999),
(25, '貓砂', 'Nurture PRO 天然密碼 豆腐砂 木炭6L (2入)', 'litter.png', '產地：中國\r\n適用對象：全齡貓\r\n成分：豆腐、玉米澱粉、檸檬酸\r\n保存期限：依包裝標示\r\n注意事項：請於乾淨的便盆中倒入2～8公分高度的貓砂，經常鏟除及清理結塊！並定期整盆更換\r\n', 999),
(26, '貓玩具', '貴妃貓躺椅', 'cattoy1.jpg', '「抓不爛，治好奴才換換病!」 酷酷貓 CO.CO.CAT 造型貴氣 x 重磅耐抓 x MIT無毒安心 ●夠大夠平坦，單貓、多貓 一個就夠! ●耐抓不易掉屑，省掉30%打掃時間! ●0.5mm大孔洞，貓咪愛抓，爪感一級棒! ●敗一個頂N年，荷包終於不瘦了!\r\n', 999),
(27, '貓玩具', '地球儀貓抓球', 'cattoy2.jpg', '實木框架 結構穩固 360度零死角 各角度盡情玩耍 創意設計 當擺飾也很療癒 優質劍麻 細膩織法不傷貓爪\r\n', 999),
(28, '貓玩具', '木天蓼滾滾玲瓏球', 'cattoy3.jpg', '◆精選野生木天蓼棒製成，不含任何化學成分，天然無毒可安心使用 ◆精選野生木天蓼棒含有高濃度獼猴桃碱讓貓咪沉醉 ◆磨牙潔齒 催吐毛球 ◆手工編織用天然麻繩緊緊將木天蓼棒編成精緻的玲瓏球 ◆造型特別，吸引貓咪注意\r\n\r\n', 999),
(29, '貓玩具', '蕃茄罐頭', 'cattoy4.jpg', '減少寵物的破壞性 緩解壓力和寂寞感 解救你的拖鞋和沙發 享受尋寶般樂趣\r\n\r\n', 999),
(30, '貓玩具', '電臀系跳跳魚', 'cattoy5.jpg', '【超級逼真的外觀!】 活跳跳就像鮮魚!可以立即吸引貓的興趣，讓他們享受抓魚的樂趣 【觸碰就跳動】 放置不玩幾分鐘後，聰明的它將進入待機模式幫你省電! 貓咪好奇觸碰一下...馬上活跳跳!XD 【清潔方便簡單】 玩到都是臭臭口水...免驚!! 魚皮可拆洗，清潔輕鬆容易，讓貓貓玩得健康不拉肚!\r\n\r\n', 999),
(31, '貓玩具', '電動不倒翁逗貓棒', 'cattoy6.jpg', '靜音運作 樂趣加分 不規律旋轉 觸法誘捕天性 一鍵開啟 主動逗貓 不倒翁造型 充滿童趣\r\n\r\n\r\n', 999),
(32, '貓玩具', '三節式 伸縮逗貓棒 藍色瓢蟲', 'cattoy7.jpg', '伸縮好操控 * 替換頭可更換不同逗貓玩具 * 碳纖維桿，強度佳、彈性好 * 泡棉握柄(顏色隨機)，重量輕、手感好 * 金屬問號掛鉤，輕鬆更換、更安全\r\n\r\n\r\n\r\n', 999),
(33, '貓玩具', '小吃貓草包 臭豆腐', 'cattoy8.jpg', '臭豆腐的好!內行才懂 獨特草纈草添加 又臭又香的特殊香氣 連主子都瘋狂\r\n\r\n\r\n\r\n\r\n', 999),
(34, '貓玩具', '100%貓薄荷填充雞腿', 'cattoy9.jpg', '1.趣味仿真造型 2.加厚布料，耐抓耐咬 3.100%有機貓薄荷 4.有機無毒的植物原料\r\n\r\n\r\n\r\n', 999),
(35, '貓玩具', '小吃貓草包 香雞排', 'cattoy10.jpg', '一份香雞排!不切要辣! 添加貓薄荷x木天蓼 厚實Q彈超好咬!\r\n\r\n\r\n\r\n\r\n', 999),
(36, '貓玩具', '100%貓薄荷填充蝦仁', 'cattoy11.jpg', '●不含棉花，100%貓薄荷填充 ●仿真造型，加厚布料不怕貓貓摧殘 ●香氣濃郁，為一般棉花款的20倍\r\n\r\n\r\n\r\n', 999),
(37, '貓玩具', '貓咪用品系列 小鳥逗貓棒 ', 'cattoy12.jpg', '高柔韌不易斷裂 讓貓咪慾不能罷 可以消耗貓咪精力，代替獵物吸引貓咪 鋼絲長約76cm，桿長約14cm\r\n\r\n\r\n\r\n\r\n', 999),
(38, '貓玩具', '花朵系列 伸縮釣竿逗貓棒', 'cattoy13.jpg', '喚起愛貓喜歡狩獵、追蹤、遊戲的天性。 適當紓壓，增進與寵物之間的互動與感情。 美麗鮮豔的花朵，容易吸引貓咪注意。 細緻輕柔的羽毛，觸感質感提升。\r\n', 999),
(39, '狗玩具', '汪老先生有塊蘿蔔園 藏食玩具', 'dogtoy1.jpg', '✅ 超多藏食小坑，訓練嗅聞! 你藏他找，讓他愛上跟你互動的每一刻! ✅ 培養狗狗耐心，消耗精力 讓他一秒安靜乖乖不吵不破壞的益智神器! ✅ 雨天居家必備 下雨天待在家不能散步，也能增加運動量，抗憂鬱不怕無聊! 汪事如意 原肉零食15克【脆脆呱呱鴨】 ✅ 100% 天然食材使用 ✅ 100%低溫乾燥 保留完整營養 ✅ 100% 無化學添加物、防腐劑 給寶貝天然享受無負擔！ 脆脆磨牙 脆脆呱呱鴨 (硬度適中★★★☆☆) 櫻桃鴨氣管，啃啃好舒壓！低脂、低油！\r\n', 999),
(40, '狗玩具', '五角邊益智轉盤', 'dogtoy3.jpg', '* 純淨原料 * 安全無毒 * 嗅聞訓練 * 智力訓練\r\n', 999),
(41, '狗玩具', '紅色經典抗憂鬱玩具', 'dogtoy2.jpg', '世界知名品牌絕佳寵物玩具製造商 動物醫師、狗狗行為學家、狗狗訓練師等強力推薦 葫蘆造型的抗憂鬱玩具~是KONG公司的經典設計 最最符合狗狗嘴型的玩具~狗狗可放在口中咀嚼~將玩具中的食物壓碎擠出 適合填充零食飼料讓狗狗打時間 狗狗拋丟的時候會產生不規則的彈跳~增添使用上的樂趣\r\n\r\n', 999),
(42, '狗玩具', 'SNOW BUMS 無帽獅子', 'dogtoy4.jpg', '堅韌技術: 高織數帆布內裡 雙車縫接縫收編 尼龍強化撕裂點 滿足天性: 愛寵拖動和啃咬時 玩具的吱吱聲能滿足狩獵慾望 鼓勵長時間的玩耍 矯正行為: 保持咀嚼 以幫助減少無聊和不理想的行爲 陪伴: 柔軟的毛絨外觀 最舒適的完美質地 愛寵臥躺、休息時的最佳陪伴\r\n\r\n\r\n', 999),
(43, '狗玩具', '耐咬史迪克-樹枝', 'dogtoy5.jpg', '散發天然的木頭香味，讓你的毛小孩咬的是安全耐咬又美味的玩具！ 美國原廠專利材料製成。 散發天然木頭香味。 無毒合成材質，不會裂開刮傷狗狗牙齦。 搖擺、晃動容易引起狗狗的興趣。 室內與室外玩耍都適合。\r\n\r\n\r\n', 999),
(44, '貓零食', '火烤嫩雞口味', 'catsnack1.jpg', '．符合美國AAFCO標準 ．每顆低於2大卡 ．多種口味變化，滿足嘴饞時刻\r\n\r\n\r\n', 999),
(45, '貓零食', '韓國 By Cat 貓咪凍乾零食', 'catsnack2.jpg', '●100%韓國製造，-40℃ 冷凍乾燥技術，保留食物完整營養價值，純天然食材製成，無添加防腐劑人工色素 ●可當作零食直接餵食，或是加入溫水泡開，增加寵物的飲水量 ●開封後請盡快餵食並置於室溫保存，勿放於冰箱或陽光直射處 ●富含胺基酸、Omega-3和高蛋白質\r\n\r\n\r\n', 999),
(46, '貓零食', '啾嚕肉泥雞肉綜合桶 ', 'catsnack3.jpg', '添加綠茶消臭成分，減少糞便異味 條狀包裝，增加餵食方便性 可加水調和，增加貓咪喝水量\r\n\r\n', 999),
(47, '貓零食', 'Kitcat 卡茲餅', 'catsnack4.jpg', '化毛配方 幫助腸胃蠕動 添加牛磺酸保護眼睛心血管 四種可愛造型 幫助貓咪潔牙\r\n\r\n', 999),
(48, '貓零食', '啾嚕迷你捲心塊', 'catsnack5.jpg', '不添加防腐劑 添加綠茶消臭成分 餅乾內有滿滿的啾嚕肉泥 易於餵食、易於食用的零食\r\n\r\n\r\n', 999),
(49, '貓零食', '啾嚕肉泥 ', 'catsnack6.jpg', '不添加防腐劑 添加綠茶消臭成分 餅乾內有滿滿的啾嚕肉泥 易於餵食、易於食用的零食\r\n\r\n\r\n', 999),
(50, '貓零食', '啾嚕肉泥 ', 'catsnack6.jpg', '不添加防腐劑 添加綠茶消臭成分 餅乾內有滿滿的啾嚕肉泥 易於餵食、易於食用的零食\r\n\r\n\r\n', 999),
(51, '貓零食', '寵貓專用營養肉泥條', 'catsnack7.jpg', 'GOMO機能型肉泥提供豐富的蛋白質，此外更添加蔓越莓、牛磺酸、化毛配方，除了提供均衡的營養和美味的味道以外，更確保毛小孩能夠獲得必需的營養素。\r\n\r\n\r\n\r\n', 999),
(52, '貓零食', '低溫烘焙肉乾零食', 'catsnack8.jpg', '堅持手工製作: 職人手工捏製，真空按摩，嫩化肉質。 肉肉看得見: 優質原肉切塊，去除筋骨雜質。 低溫烘烤: 70度低溫烘烤24小時，慢火熟成，鎖住完整營養，香氣十足。 天然無負擔: 無添加防腐劑、香精、色素。\r\n\r\n\r\n\r\n\r\n', 999),
(53, '狗零食', '犬用野菜棒', 'dogsnack2.jpg', '鬆脆美味棒狀餅乾，採用日本當地種植蔬菜，含有豐富的維生素，礦物質和食物纖維。 不使用麵粉，無麩質零食。 非油炸製作。\r\n\r\n\r\n\r\n', 999),
(54, '狗零食', '韓國 By Dog 爆毛雞肉棒棒糖', 'dogsnack3.jpg', '100%國產新鮮食材 雞肉/ 羊肉 / 羊肉三種口味選擇 雙層口味更滿足\r\n\r\n\r\n\r\n', 999),
(55, '狗零食', '手作鴨氣管', 'dogsnack4.jpg', '100%純天然鴨氣管製作 香脆好咬的食感，可稱毛孩的脆笛酥！ 卡滋卡滋~小狗狗或是喜歡啃咬的貓咪吃也OK\r\n\r\n\r\n\r\n\r\n', 999),
(56, '狗零食', '香濃雞肉圈', 'dogsnack5.jpg', '台灣製造/嚴選食材/品質安心 我們堅持 選用台灣國產及紐澳食材，台灣在地生產製造。 使用人類等級食材，提供寵物優質零食。 製程嚴格，專業生產殺菌設備，減少病原孳生。 不添加防腐劑，寵物吃得開心，飼主也安心。\r\n\r\n\r\n\r\n\r\n', 999),
(57, '狗零食', '主廚嚴選香軟牛肉切塊', 'dogsnack6.jpg.png', '日本直送進口寵物零食 添加蔬菜幫助消化 多種口味，鮮美可口\r\n\r\n\r\n\r\n\r\n\r\n', 999),
(58, '狗零食', '原肉零食 軟骨雞小扁條', 'dogsnack6.jpg', '日本直送進口寵物零食 添加蔬菜幫助消化 多種口味，鮮美可口\r\n汪事如意 原肉零食 軟骨雞小扁條 50g 食材列表（硬度★★★☆☆） 100% 低溫乾燥 保留完整營養 100% 頂級原肉製作 犬貓皆適合 100% 無化學添加物、防腐劑\r\n\r\n\r\n\r\n\r\n', 999),
(59, '寵物窩', '寵物睡窩 - 仙人掌', 'pethouse1.jpg', '● 全包圍設計 綿軟回彈\r\n● 可拆卸軟墊 鎖住溫度\r\n● 絲滑面料 清潔方便\r\n● 可容納9公斤內貓咪或5公斤內小型犬自由進出\r\n● 精緻工藝 可愛仙人掌造型\r\n\r\n\r\n', 999),
(60, '寵物窩', '圓頂寵物帳篷 ', 'pethouse2.jpg', '● 寬敞空間 貓狗通用\r\n● 立體圓弧結構\r\n● 封閉式設計安全感十足\r\n● 便攜易提且收納方便\r\n\r\n\r\n\r\n', 999),
(61, '寵物窩', '防塌陷寵物沙發', 'pethouse3.jpg', '● 精緻慵懶 坐享自在\r\n● 蓬鬆柔軟可依靠\r\n● 可拆卸 易淸洗易打理\r\n● 底部滴膠顆粒防滑\r\n\r\n\r\n\r\n', 999),
(62, '寵物窩', '花朵沙發寵物窩', 'pethouse4.jpg', '● 柔軟舒適 親膚面料\r\n● 大面積想怎麼躺就怎麼躺\r\n● 內置彈力海綿 不易變形\r\n● 水晶絨表布可拆卸清洗\r\n● 底部採防滑設計\r\n\r\n\r\n\r\n', 999),
(63, '寵物窩', '毛絨寵物窩 -', 'pethouse5.jpg', '● 可口布丁造形陪你過冬\r\n● 優質棉花絨面料\r\n● 內部舒適 柔軟溫暖\r\n● 內執可拆洗', 999),
(64, '寵物窩', '趴趴熊寵物窩', 'pethouse6.jpg', '柔柔的肚皮 軟軟的小窩\r\n● 逗趣造型 為生活增添樂趣\r\n● 四腳朝天的小浣熊 肚皮就是小窩\r\n● 半包裹性設計 重回媽媽身體的溫暖安心\r\n● 雪兔絨填充PP棉 柔軟親膚舒適\r\n\r\n\r\n\r\n\r\n', 999),
(65, '寵物窩', '浴缸造型寵物窩', 'pethouse7.jpg', '● 花灑逗貓棒 自助逗貓\r\n● 逗貓棒可整根取出 自由揮舞\r\n● 高回彈海綿 大大浴缸好好躺\r\n● 有頭巾又有浴巾 沈浸式泡澡\r\n● 蓬蓬內墊 可拆卸清洗\r\n● 贈發聲小鴨玩具*1\r\n\r\n\r\n', 999),
(66, '寵物窩', '造型寵物窩 ', 'pethouse8.jpg', '● 給牠半封閉秘密基地\r\n● 緊緊包裹的安全感\r\n● 暖絨絨餅乾守護你\r\n● 立體海綿支撐不塌陷\r\n\r\n\r\n\r\n', 999),
(67, '寵物窩', '夏季清涼窩', 'pethouse9.jpg', '● 可睡可抓 兼顧小睡與玩耍\r\n● 輕盈懸浮小吊床 如同躺在天空之雲朵\r\n● 附贈一塊抓板\r\n● 安心材質 輕鬆打理\r\n\r\n\r\n\r\n\r\n', 999),
(68, '寵物窩', '寵物多功能便攜墊 ', 'pethouse10.jpg', '● 隨心所欲的收納\r\n● 雙面設計 多種變化\r\n● 親膚材質 柔軟舒適\r\n● 方便收納設計\r\n\r\n\r\n\r\n\r\n\r\n', 999),
(69, '寵物窩', '四季帳篷寵物窩', 'pethouse11.jpg', '● 登山棉舒適耐用 透氣無異味\r\n● 實木支撐 結實穩固\r\n● 走線平整 針距極密\r\n● 加厚訂製滑防顆粒底部 穩固牢靠\r\n● 半封閉式帳篷環境 給牠滿滿的安全感\r\n\r\n\r\n\r\n\r\n', 999),
(70, '其他用品', '米家智能寵物餵食器', 'petSupplies1.png', '機體分離設計 安心水洗\r\n三重防潮鎖鮮 每天都吃新鮮糧\r\n秤重餵食碗 碗內餘糧精準可知防潮防霉)\r\n', 999),
(71, '其他用品', '霍曼寵物餵食器', 'petSupplies2.png', '定時定量出糧，杜絕貪吃大胃王\r\n✔適用小於12mm凍乾糧及各式乾糧\r\n✔360度全密封，乾燥防潮多重鎖鮮\r\n✔遠端APP控制，餵食計畫全掌握\r\n✔雙重供電系統，停電不怕斷炊\r\n✔易拆洗設計，輕鬆拆卸水洗\r\n', 999),
(72, '其他用品', '防打翻寵物護頸碗', 'petSupplies3.png', 'PP樹脂材質 安全無毒無異味\r\n使用光滑表面設計 寵物更容吃飯\r\n大容量 寵物吃的盡興用的放心\r\n', 999),
(73, '其他用品', '樂高寵物護頸斜口碗', 'petSupplies4.png', '環保PP材料耐摔耐用易清洗\r\n-10度傾斜角度減少低頭壓迫\r\n寬大碗型進食不髒臉不碰鼻', 999),
(74, '其他用品', '質感喵 陶瓷貓咪護頸碗', 'petSupplies5.png', '嬰用級陶瓷 拒絕黑下巴\r\n大容量高包圍， 食物不易掉出\r\n容量適中 滿足貓咪食量', 999),
(75, '其他用品', '斯普尼克 增高防蟻碗2入', 'petSupplies6.png', '注水設計，防止螞蟻侵食\r\n碗架高度可調整\r\n食品級不鏽鋼碗', 999);
